Fulfill this database query: give me all the country that have presidents .  Use these TABLE_DEFINITIONS to satisfy the database query.

TABLE_DEFINITIONS

CREATE TABLE states (
name character varying,
continent character varying,
indep_year integer,
fert_rate real,
women_parli_perc real
);

CREATE TABLE prime_ministers (
country character varying,
continent character varying,
prime_minister character varying
);

CREATE TABLE presidents (
country character varying,
continent character varying,
president character varying
);
